 CREATE OR REPLACE VIEW RRHHVDEFAULTCALENDAR AS SELECT a.FESTIVOS as FESTIVOS,a.DEFECTO as DEFECTO,a.DESCRIPCION as DESCRIPCION,a.DOMINGO as DOMINGO,a.JUEVES as JUEVES,a.LUNES as LUNES,a.MARTES as MARTES,a.MIERCOLES as MIERCOLES,a.SABADO as SABADO,a.NOMBRE as NOMBRE,a.VIERNES as VIERNES,aa.TIPO as TIPO,aa.FECHA as FECHA,aa.DESCRIPCIN as DESCRIPCIN,aa.IDXRRHHFESTIVOS as IDXRRHHFESTIVOS,aa.IDRRHHCALENDARIO0 as IDRRHHCALENDARIO0 FROM RRHHFESTIVOS aa
 INNER JOIN 
RRHHCALENDARIO a ON a.IDXRRHHCALENDARIO = aa.IDRRHHCALENDARIO0 WHERE   a.DEFECTO = true;
